  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Mark Twain
  NWR (Clarence Cannon and Delair Units) outlines Refuge accomplishments during the
  second half of 1975. The report begins by summarizing the weather conditions, habitat
  conditions, water conditions, and food and cover conditions during the year. Wildlife-
  including migratory birds, upland game birds, big game animals, furbearers, and
  reptiles- is also covered. The Refuge development and maintenance section discusses
  physical developments, plantings, vegetation control, prescribed burning, wildfires,
  and animal control. Resource management is outlined. A progress report on field
  investigations and applied research is also provided. The public relations section
  of the report describes recreational uses. Items of interest are attached.\",\n\t\"owner_org\":
